import { stopWords, text } from "./stopWords.js";
import JSON5 from "json5";

import React, { useState, useEffect } from "react";

const Parser = () => {
  const [tokens, setTokens] = useState({});

  useEffect(() => {
    fetch("/tokens", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(text),
    })
      .then((response) => response.text())
      .then((data) => {
        // console.log(data);
        const object = JSON5.parse(data);
        console.log(object);
        setTokens(object);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h2>
        <br></br>
        Paragraphe :<br></br>
        <br></br>
        {text}
      </h2>

      <table class="table table-bordered table-striped">
        <thead>
          <tr>
            <th>Mots</th>
            <th>Fr√©quences</th>
          </tr>
        </thead>
        <tbody>
          {tokens &&
            Object.entries(tokens).map(([key, value]) => (
              <tr key={key}>
                <td>{key}</td>
                <td>{value}</td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
};

export default Parser;
